const Home = () => {
	return (
		<div className="flex w-3/5 mt-16 mx-3">
			<div>
				<p className=" bg-green-500 text-white w-fit px-2 mb-4">
					PROJECT INCOME-EXPENSE TRACKER
				</p>
				<p>Track Your Income and Expense in One Place</p>
				<p>
					Worried where all your money goes each month? Tired of
					complicated finance softwares? Try our simple Income &
					Expense Tracking Application, the simple way to track your
					income and Expense
				</p>
				<span>
					<button>Request A Demo</button>
					<button>Sign Up</button>
				</span>
			</div>
			<div>right</div>
		</div>
	);
};

export default Home;
